package com.eatrightapp.external.yelp.v1;

public class Review {
	private String id;
	private String textExcerpt;
	private String url;
	private String userName;
	private String userPhotoUrl;
	private String userPhotoUrlSmall;
	private double rating;
	private String ratingImgUrl;
	private String ratingImgUrlSmall;
	private String mobileUrl;
	private String userUrl;
	private String date;
	public String getId() {
		return id;
	}
	public void setId(String id) {
		this.id = id;
	}
	public String getTextExcerpt() {
		return textExcerpt;
	}
	public void setTextExcerpt(String textExcerpt) {
		this.textExcerpt = textExcerpt;
	}
	public String getUrl() {
		return url;
	}
	public void setUrl(String url) {
		this.url = url;
	}
	public String getUserName() {
		return userName;
	}
	public void setUserName(String userName) {
		this.userName = userName;
	}
	public String getUserPhotoUrl() {
		return userPhotoUrl;
	}
	public void setUserPhotoUrl(String userPhotoUrl) {
		this.userPhotoUrl = userPhotoUrl;
	}
	public String getUserPhotoUrlSmall() {
		return userPhotoUrlSmall;
	}
	public void setUserPhotoUrlSmall(String userPhotoUrlSmall) {
		this.userPhotoUrlSmall = userPhotoUrlSmall;
	}
	public double getRating() {
		return rating;
	}
	public void setRating(double rating) {
		this.rating = rating;
	}
	public String getRatingImgUrl() {
		return ratingImgUrl;
	}
	public void setRatingImgUrl(String ratingImgUrl) {
		this.ratingImgUrl = ratingImgUrl;
	}
	public String getRatingImgUrlSmall() {
		return ratingImgUrlSmall;
	}
	public void setRatingImgUrlSmall(String ratingImgUrlSmall) {
		this.ratingImgUrlSmall = ratingImgUrlSmall;
	}
	public String getMobileUrl() {
		return mobileUrl;
	}
	public void setMobileUrl(String mobileUrl) {
		this.mobileUrl = mobileUrl;
	}
	public String getUserUrl() {
		return userUrl;
	}
	public void setUserUrl(String userUrl) {
		this.userUrl = userUrl;
	}
	public String getDate() {
		return date;
	}
	public void setDate(String date) {
		this.date = date;
	}
	
}
